import React from "react";

function Footer() {
  return (
    <div className="pt-10">
      <video
        src="https://portfolio-elisa-2023.s3.eu-west-1.amazonaws.com/gy9oxy.mp4"
        autoplay
        loop
        muted
      >
        Your browser does not support the video tag.
      </video>
    </div>
  );
}

export default Footer;
